package comp533.joiner;

import gradingTools.comp533s19.assignment0.AMapReduceTracer;

public class Joiner extends AMapReduceTracer implements JoinerInterface {
	int count;
	int totalFinish = 0;
	
	public Joiner(final int numThreads) {
		count = numThreads;
	}
	
	public int getTotalFinished() {
		return totalFinish;
	}
	
	@Override
	public String toString() {
		return JOINER;
	}
	
	@Override
	public synchronized void finished() {
		totalFinish++;
		traceJoinerFinishedTask(this, count, totalFinish);
		
		
	}

	@Override
	public synchronized void join() {
		// TODO Auto-generated method stub
		while (totalFinish < count) {
			try {
				traceJoinerWaitStart(this, count, totalFinish);
				wait();
				traceJoinerWaitEnd(this, count, totalFinish);
			} catch (InterruptedException e) {
				e.printStackTrace();
			}
		}
		traceNotify();
		notify();
		traceJoinerRelease(this, count, totalFinish);
		//totalFinish = 0;
		
	}

}

package comp533.barrier;

import gradingTools.comp533s19.assignment0.AMapReduceTracer;

public class Barrier extends AMapReduceTracer implements BarrierInterface {
	final int count;
	int numCalls = 0;

	public Barrier(final int numThreads) {
		count = numThreads;
	}

	@Override
	public String toString() {
		return BARRIER;
	}

	@Override
	public synchronized void barrier() {
		numCalls++;
		while (numCalls < count) {
			try {
				traceBarrierWaitStart(this, count, numCalls);
				wait();
				traceBarrierWaitEnd(this, count, numCalls);
			} catch (InterruptedException e) {
				e.printStackTrace();
			}
		}
		numCalls = 0;
		notifyAll();
		traceBarrierReleaseAll(this, count, numCalls);
		
	}
}

